import './App.css';
import { useState, useEffect } from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import AboutView from './components/AboutView';
import SearchView from './components/SearchView';

import { Routes, Route } from 'react-router-dom';


function App() {

  const [searchResults, setSearchResults] =useState([])
  const [searchText, setSearchText] = useState('')

  useEffect(() => {
    console.log(searchText, "is the search text");
    const apiKey = 'YOUR_RAPIDAPI_KEY'; // Replace with your actual RapidAPI key

    fetch(`https://utelly-tv-shows-and-movies-availability-v1.p.rapidapi.com/lookup?term=${searchText}`, {
      method: 'GET',
      headers: {
        'X-RapidAPI-Host': 'utelly-tv-shows-and-movies-availability-v1.p.rapidapi.com',
        'X-RapidAPI-Key': apiKey,
        'Content-Type': 'application/json',
      },
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setSearchResults(data.results); // Assuming the results are in the "results" property of the response
      })
      .catch((error) => {
        console.error(error);
      });
  }, [searchText]);



  return (
    <div>
      <Navbar searchText={searchText} setSearchText={setSearchText}/>
      <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<AboutView />} />
          <Route path="/search"  element={<SearchView  keyword={searchText} searchResults={searchResults} />} />
      </Routes>

    </div>
  );
}

export default App;

